    console.error(e);
    res.json({ error: 'Not connected!' });
  }
};

</code></pre>
<p>The error is &quot;TypeError: (0 , <em>lib_mongodb__WEBPACK_IMPORTED_MODULE_0</em>_.clientPromise) is not a function&quot;</p>

