Typegoose is not saving array subdocuments properly in Nest.js app<p>I'm attempting to save an array of <code>TaskOutcome</code> subdocuments in my <code>Task</code> model, following the <a href="https://typegoose.github.io/typegoose/docs/api/decorators/prop/#array-options" rel="nofollow noreferrer">typegoose documentation</a>:</p>
<pre class="lang-js prettyprint-override"><code>import { prop } from '@typegoose/typegoose';

class TaskOutcome {
   @prop({ required: true }) public inputId: string;
   @prop() public label?: string;
   @prop() public value?: string;
}

export class Task {
   @prop() public _id: string;
   ...
   @prop({ _id: false, type: () =&gt; [TaskOutcome] })
   public outcomes: TaskOutcome[];
}
</code></pre>
<pre class="lang-js prettyprint-override"><code>@Injectable()
export class TaskService {

   constructor(
      @InjectModel(Task) private readonly model: ReturnModelType&lt;typeof Task&gt;,
   ) {}

   public async saveTask(data: TaskDTO) {
      console.log(data.outcomes);
      const options: QueryOptions = { upsert: true, new: true };
      const result = await this.model.findByIdAndUpdate(data.id, data, options);
      console.log(result.outcomes);
   }
}
</code></pre>
<p>When I save a task document, all its props are saved as expected, except the <code>outcomes</code> array subdocuments. Instead, all I get is an array of empty objects. So even though the first <code>console.log</code> above shows me the correct input data, the second <code>console.log</code> gives me <code>[{},{},{}]</code> (confirmed when inspecting the database).</p>
<p>Anything obvious I'm doing wrong?</p>
<p>I'm using <code>@nestjs/core@8.2.4</code>, <code>@typegoose/typegoose@9.3.1</code>, <code>nestjs-typegoose@7.1.38</code>, and <code>mongoose@6.1.2</code></p>

