Conversion 'GridFSBucketWriteStream' to type 'WritableStream' impossible?<p>Recently the conversion of <code>GridFSBucketWriteStream</code> to type <code>WritableStream</code> became impossible and leads to a types error.</p>
<pre><code>const wst = svcMng.DBService.projectImageGrid.openUploadStream(image.name);
const uploadPromise = new Promise((resolve, reject) =&gt; {
    const read = new Readable({
        read() {
            this.push(image.data);
            this.push(null);
        }
    });

    read.on('error', (err) =&gt; {
        reject(err);
    });
    read.on('end', () =&gt; {
        resolve(null);
    });
    read.pipe(wst);
});
