<p>Of course <code>read.pipe(wst as any)</code> solve the issue but I would like to avoid it.</p>
<p><code>read.pipe(wst as NodeJS.WritableStream)</code> is not working also.</p>
<p>Versions:</p>
<ul>
<li>mongoose: 6.1.4</li>
<li>typescript: 4.1.2</li>
<li>node v12.16.3</li>
</ul>
<p>Thank you in advance for the help !</p>

