MongoDB: count both matching documents and matching subdocuments, grouped by property of document<p>Given a collection of documents each containing an array of subdocuments (among other properties):</p>
<pre class="lang-json prettyprint-override"><code>    {
        &quot;prop1&quot;: False,
        &quot;prop2&quot;: &quot;unique_value&quot;,
        &quot;subdocuments&quot;: [
            {
                &quot;subprop1&quot;: 1,
                &quot;subprop2&quot;: 10
            },
            {
                &quot;subprop1&quot;: 30,
                &quot;subprop2&quot;: 40
            },
            {
                &quot;subprop1&quot;: 10,
                &quot;subprop2&quot;: 1
            }
        ]
    }
</code></pre>
<p>And a $match query covering both documents and subdocuments:</p>
<pre class="lang-js prettyprint-override"><code>    {
        &quot;prop1&quot;: False,
        &quot;$or&quot;: [
            {&quot;subdocuments.subprop1&quot;: {&quot;$lt&quot;: 3}},
            {&quot;subdocuments.subprop2&quot;: {&quot;$lt&quot;: 5}}
        ]
    }
</code></pre>
<p>How can I create an aggregate query that returns the number of <strong>matching subdocuments and matching documents, grouped by a specific property of the root documents</strong>?</p>
<p>Just counting total subdocuments and matching documents is simple, but I'm struggling to also get the right count of matching subdocuments.</p>
<p>Ideally I'd like to have a result like this (if we consider the sample document, only subdoc 1 and 3 match the $or conditions):</p>
<pre class="lang-json prettyprint-override"><code>    {
        &quot;unique_value&quot;: {
            &quot;documents&quot;: 1,
            &quot;subdocuments&quot;: 2
        }
    }
</code></pre>
<p>In this case the results are being grouped by the value of &quot;prop2&quot;.</p>

